import React, { Component } from 'react';

export default class HomePage extends  Component {
    render(){
        return (
            <div>
                <p>CCICC is India's largest and leading insurance aggregator website. They are specialized in making comparative analysis of the insurance products of various insurance policies based on price, quality and key benefits. Their punch line, Insurance Compare Kiya? says it all. Their unique comparative system boosts Their credibility. They empower customers with comparative and accurate information on Insurance products combined with solution driven customer service. Their technology backed service is convincing and adds value to their customers. Using their industry knowledge, service-offering expertise and technical capabilities, they develop solutions leading to financial security and competitive returns. To know about their booking process, please click on Policybazaar Booking Process.</p>
            </div>
        );
    }
}
